int lcm(int a, int b)
{
  int max = (a > b) ? (a) : (b);
  while (1)
  {
    if (((max % a) == 0) && ((max % b) == 0))
    {
      return max;
    }

    max++;
  }

}

int gcd(int a, int b)
{
  int t;
  int max = (a > b) ? (a) : (b);
  while (1)
  {
    if (((max % a) == 0) && ((max % b) == 0))
    {
      t = (a * b) / max;
      return t;
    }

    max++;
  }

}

