int maxFromBottom(int i, int j)
{
  if (i < 0)
    return 0;

  if (cache[i][j] != (-1))
    return cache[i][j];

  int path1 = 0;
  if (j != 0)
    path1 = maxFromBottom(i - 1, j - 1);

  int path2 = maxFromBottom(i - 1, j);
  int max = (path1 > path2) ? (path1) : (path2);
  cache[i][j] = a[i][j] + max;
  return a[i][j] + max;
}

