int find_sum(int *triangle, int row, int column, int rows)
{
  int below;
  int right;
  int next_row = row + 1;
  if (next_row == rows)
  {
    return triangle[(row * 100) + column];
  }

  below = find_sum(triangle, next_row, column, rows);
  right = find_sum(triangle, next_row, column + 1, rows);
  return triangle[(row * 100) + column] + ((below > right) ? (below) : (right));
}

int find_max_sum(int *triangle, int rows)
{
  return find_sum(triangle, 0, 0, rows);
}

