long unsigned int leastCD(long unsigned int a, long unsigned int b);
long unsigned int greatestCD(long unsigned int a, long unsigned int b)
{
  int k;
  int j;
  if (a > b)
  {
    while (1)
    {
      k = a / b;
      j = a - (k * b);
      if (j == 0)
        break;

      a = b;
      b = j;
    }

    return b;
  }
  else
  {
    while (1)
    {
      k = b / a;
      j = b - (k * a);
      if (j == 0)
        break;

      b = a;
      a = j;
    }

    return a;
  }

}

long unsigned int leastCD(long unsigned int a, long unsigned int b)
{
  return (a * b) / greatestCD(a, b);
}

