static int calcucateMaxSumChain(tTheArray *pTheRow, int numberOfRows)
{
  int i;
  int chainIdx;
  int MaxSum = 0;
  for (i = 0; i < numberOfRows; i++)
  {
    if (i == 0)
    {
      chainIdx = 0;
      MaxSum = pTheRow[i].pTheArray[chainIdx];
    }
    else
    {
      if (pTheRow[i].pTheArray[chainIdx] < pTheRow[i].pTheArray[chainIdx + 1])
      {
        chainIdx++;
      }

      MaxSum += pTheRow[i].pTheArray[chainIdx];
    }

  }

  return MaxSum;
}

