void shell_sort(int arr[], int length)
{
  int i;
  int gap;
  int j;
  int key;
  for (gap = length / 2; gap > 0; gap /= 2)
  {
    for (i = gap; i <= (length - 1); i++)
    {
      key = arr[i];
      for (j = i; (j >= gap) && (arr[j - gap] > key); j -= gap)
        arr[j] = arr[j - gap];

      arr[j] = key;
    }

  }

}

