      if (j == 0)
        arr[i][j] = arr[i][j] + arr[i - 1][j];
      else
        arr[i][j] = arr[i][j] + max(arr[i - 1][j], arr[i - 1, j - 1]);

    }

  }

  for (i = 0; i < n; i++)
  {
    if (arr[n - 1][i] > maxlen)
      maxlen = arr[n - 1][i];

  }

  return maxlen;
}

