unsigned long long int getGCD(unsigned long long int A, unsigned long long int B)
{
  unsigned long int max;
  unsigned long int min;
  unsigned long int t;
  unsigned long int s;
  if (A > B)
  {
    max = A;
    min = B;
  }
  else
  {
    max = B;
    min = A;
  }

  if ((max % min) == 0)
  {
    return min;
  }
  else
  {
    while (1)
    {
      t = max % min;
      if (t == 0)
        break;

      s = min;
      min = t;
      max = s;
    }

    return min;
  }

}

